ness.\", \"All this love and attention goes into our Petits Pois - picked when they are young and juicy to give you a burst of sweetness every time.\", \"Our Petits Pois are a source of Vitamin C and a rich source or protein which makes them great for your minimum system* and for your muscles**\", \"*Vitamin C contributes to the normal function of the immune system\", \"**Protein contributes to the maintenance of muscle mass\", \"A burst of sweetness, Source of vitamin C, With love, 1 of 5 a day servings, No artificial colours, flavours or preservatives\", \"Boil - From Frozen. Place in pan and add sufficient boiling water to recover.\", \"Bring back to the boil.\", \"Cover and simmer for 2 minutes.\", \"Drain and serve.\", \"Season to taste.; Cooking Instructions - General. To retain more vitamins, Microwave straight from the freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Microwave - From Frozen. For 160g (2 servings).\", \"Place the Petits Pois in a microwavable bowl.\", \"Add 15ml (1tbsp) water and cover.\", \"Microwave on Full Power for:\", \"700W: 3 1/2 mins, 800W: 3 mins, 900W: 2 1/2 mins\", \"Drain and serve. Season to taste.\", \"Pack\", \"Packing - Recycle with carrier bags at larger stores - Not at Kerbside\", \"Full Product Name:\", \"Petits Pois\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"See back of pack for best before end date\", \"Usage:\", \"6 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Petits Pois as part of a varied and balanced diet and healthy lifestyle\", \"For more visit birdseye.co.uk\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/456/45609011_1_640x640.jpg?identifier=31eb331dcd298cdb4ec59b3ff8efd207','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Peas & Broad Beans','Green Peas','yes','null','null','null','null','1.5','null','null','null','null','null','null','null','Ocado','null');
