olesterol levels.\", \"Made with real mash and vegetables, No artificial colours, flavours or preservatives, Gluten free, Suitable for vegans\", \"Keep Frozen\", \"Cooking Instructions - General. Tastiest when Oven Baked Straight from the Freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Grill - From Frozen. High Grill 5-10 mins\", \"Pre-heat the grill.\", \"Turn over occasionally.\", \"Cook for the required time.\", \"Do not overcook.\", \"Follow recommended cooking times.; Oven cook - From Frozen. 220\\u00b0C, Fan 200\\u00b0 C, Gas Mark 7 10-15 mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Turn over halfway through cooking.\", \"Cook for the required time.\", \"Do not overcook.\", \"Follow recommended cooking times.\", \"If preparing smaller quantities, reduce the cooking time.\", \"Pack\", \"Full Product Name:\", \"A mixture of mini waffles made from seasoned potato mash and a blend of vegetables, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Usage:\", \"6 Servings\", \"Additional Information:\", \"The number of each waffle variety will vary by pack.\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Rainbow Mini Waffles as part of a varied and balanced diet and healthy lifestyle. Children\'s nutritional needs differ to those of adults consequently smaller portion sizes may be appropriate\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Beetroot Waffle: Potato, Beetroot (31%), Sunflower Oil, Rice Flour, Dried Potato, Salt, Stabiliser (E464)#, Dextrose, Turmeric, Garden Pea Waffle: Potato, Garden Peas (32%), Sunflower Oil, Rice Flour, Dried Potato, Salt, Stabiliser (E464)#, Dextrose, Turmeric, Sweet Potato Waffle: Sweet Potato (40%), Potato, Sunflower Oil, Rice Flour, Dried Potato, Salt, Stabiliser (E464)#, Dextrose, Turmeric, Potato Waffle: Potato, Sunflower Oil, Rice Flour, Dried Potato, Salt, Stabiliser (E464)#, Dextrose, Turmeric, #E464 is derived from a natural plant material. We use it to control the level of fat absorbed by the waffles and to maintain their shape & texture\", \"Free From Gluten\", \"Suitable for Vegans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Chips, Potatoes & Rice','Potato Products','null','null','yes','null','null','null','null','2.5','null','null','null','null','null','null','null','Ocado','null');
