ur Chicken Dippers contain raw meat, please ensure that they are cooked thoroughly until piping hot throughout.\", \"Tastiest when oven baked straight from the freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Grill - From Frozen. Medium Grill 12 Mins\", \"Pre-heat the grill.\", \"Turn over occasionally.\", \"Cook until crisp and golden.; Oven cook - From Frozen. 210\\u00b0C, Fan 190\\u00b0C, Gas Mark 7 15 Mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Cook until crisp and golden.\", \"Box\", \"Carton - Recyclable\", \"Full Product Name:\", \"Dippers formed from chopped marinated chicken breast meat, coated in a light batter, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"2 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared forever.\", \"For a Sustainable Tomorrow\", \"Making a difference with responsibly sourced and prepared food every day\", \"birdseye.co.uk/Our-Sustainable-Path\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline Information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Chicken Breast (50%), Water, Breadcrumbs (Fortified\", \"Wheat\", \"Flour (\", \"Wheat\", \", Calcium Carbonate, Iron, Niacin, Thiamin), Salt, Sunflower Oil), Rapeseed Oil, Fortified\", \"Wheat\", \"Flour (\", \"Wheat\", \", Calcium Carbonate, Iron, Niacin, Thiamin), Flour (Maize, Rice), Cornflour, Salt, Raising Agents (Diphosphates, Sodium Carbonates), Palm Oil, Lactose (\", \"Milk\", \"), Natural Flavourings,\", \"Wheat\", \"starch\", \"May Contain Eggs, Contains Milk, Contains Wheat\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/253/253703011_1_640x640.jpg?identifier=c11700a205426dcfc47c0413303cb759','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Meat & Poultry','Breaded Chicken, Nuggets & Kievs','Nuggets & Bites','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
