 was that?\", \"Delicious in 4 mins, Pyramid =  2 portions, No artificial colours, flavours or preservatives, Suitable for vegans\", \"UK\", \"Keep frozen.\", \"Cooking Instructions - General. Microwave straight from the freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Microwave - From Frozen. 1. Open the outer bag. Remove the pyramid bag(s) and place with the Green Corner Upwards, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping and shake the bags halfway through cooking.\", \"Do not pierce he bag. Do not microwave the outer (printed) packaging.\", \"2. Microwave on Full Power for:\", \"700W: 1 bag 3 1/12 mins, 2 bags 7 mins\", \"800W: 1 bag 3 mins, 2 bags 6 mins\", \"900W: 1 bag 3 mins, 2 bags 6 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, shake, then cut the bag open to serve.\", \"Be careful! The contents will be very hot. Stir well.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to escape slowly during cooking.; Shallow Fry - From Frozen. Alternative, Pan cook\", \"Low / Medium heat 5-7 mins\", \"Empty the contents of the bag into a pan.\", \"Add 1-2 tablespoons of water to prevent the rice from sticking to the pan.\", \"Heat gently with a lid on to retain moisture.\", \"Stir frequently until cooked, adding more water if required.\", \"Unspecified Pack\", \"Full Product Name:\", \"Steamed Long Grain Rice with Mediterranean Style Vegetables and Seasoning.\", \"Storage:\", \"Store in a Freezer at -18\\u00baC or cooler\", \"Usage:\", \"2 Servings\", \"Birds Eye\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and preparing your food, creating new products that contribute to a balanced diet, and helping everyone to reduce food waste.\", \"For more, visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Care information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Cooked Rice (59%) (Water, Rice, Salt), Vegetables (35% in varying proportions) (Courgette, Red Pepper, Onion, Grilled Aubergine (Aubergine, Sunflower Oil)), Tomato Powder, Basil, Sunflower Oil, Extract Virgin Olive Oil, Oregano, Onion Powder, Spices, Garlic Powder\", \"Suitable for Vegans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Chips, Potatoes & Rice','Rice','null','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
