8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Cauliflower (25%), Carrot (25%), Peas (25%), Broccoli (25%)\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Mixed Packs','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
