er defrosting.\", \"Try our Salmon Fillets with a sweet chilli & ginger sauce served with a fresh vegetable saladOur 3 steps to taste heaven!1 - Place our unique perfect cook bag in microwave or oven for the recommended time2 - Take out carefully and gently shake bag to create a deliciously saucy fish dish3 - Remove from the bag and serve to enjoy tasty, gorgeous fish, with no fuss.\", \"Cooking Instructions - General. Tastiest when Oven Baked Straight from the Freezer.\", \"To serve: Remove the bag from the oven/microwave, shake gently.\", \"Tear or cut the end of the bag with scissors.\", \"Be careful! The bag and contents will be very hot.\", \"Fish comes in all sorts of shapes and sizes, and so do ovens and microwaves, so while you\'ll always get a tasty fish dish the shape of fillet and sauce quantity may also vary.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Microwave - From Frozen. Alternatively, microwave.\", \"1 bag\", \"Full power for: 700W 4 mins\", \"Full power for: 800W 4 mins\", \"Full power for: 900W 3 1/2 mins\", \"2 bags\", \"Full power for: 700W 8 mins\", \"Full power for: 800W 8 mins\", \"Full power for: 900W 7 mins\", \"Let stand for 1 minute.; Oven cook - From Frozen. Pre-heat the oven 190\\u00b0C Fan 170\\u00b0C Gas Mark 5 25 mins\", \"Place the bag containing the fish on a baking tray in the middle of the oven.\", \"Do not pierce the bag.\", \"Cook for the required time.\", \"Two or more portions may require longer time.\", \"Box\", \"Carton - Recyclable; Film - Not Recyclable\", \"Full Product Name:\", \"Wild pink salmon fillets with a sweet chilli and ginger sauce.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"2 Servings\", \"Additional Information:\", \"MSC - Certified Sustainable Seafood, MSC\\u2122, MSC-C-50470, Thank you for choosing fish that has met the MSC\'s global standard for sustainability. Together we can help protect fish stocks for the future. Find out more at www.msc.org\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provides you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Wild Pink Salmon (\", \"Fish\", \") (83%), Water, Palm Kernel Oil, Rapeseed Oil, Ginger, Sugar, Rice Starch, Salt, Red Chilli Pepper, Tomato Pur\\u00e9e, Concentrated Lemon Juice, Parsley, Garlic, Natural Emulsifier (Sunflower Lecithin)#, Spirit Vinegar, Lemongrass, Extra Virgin Olive Oil, Lemon Extract, #Lecithin is used to help the Sauce blend with the Fish Juices on cooking, it is a natural material found in many traditional food ingredients\", \"Contains Fish, May Contain Milk, May Contain Mustard, May Contain Wheat\", \"May also contain\", \"Wheat, Milk\", \"and\", \"Mustard\", \"Contains Fish\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/941/94172011_1_640x640.jpg?identifier=efa19215947a809ad4105be74cfd70cc','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fish','Fish Pies & Meals','Fish Dishes','null','yes','null','null','null','null','4.5','null','null','null','null','null','null','null','Ocado','null');
