nsure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Grill - From Frozen. Medium Grill 10 mins\", \"Pre-heat the grill.\", \"Base of grill pan.\", \"Turn over occasionally.\", \"Cook until crisp and golden yellow.\", \"Do not overcook.\", \"Follow recommended cooking times.; Oven cook - From Frozen. 220\\u00b0C, Fan 200\\u00b0C, Gas Mark 7 12-15 mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Turn over halfway through cooking.\", \"Cook until crisp and golden yellow.\", \"Do not overcook.\", \"Follow recommended cooking times.\", \"If preparing smaller quantities, reduce the cooking time.\", \"Our real potatoes vary throughout the year, so the time taken to become crisp and golden yellow may also vary.\", \"Pack\", \"Film - Plastic - Not Currently Recycled\", \"Full Product Name:\", \"Potato shapes made with freshly mashed potatoes, prefried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"8 Servings\", \"Additional Information:\", \"Although all letters of the alphabet are made we cannot guarantee one of each letter in every pack.\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Potato (89%), Rapeseed Oil, Potato Granules, Potato Starch, Salt, Stabiliser (E464)#, White Pepper, # E464 is derived from a natural plant material. We use it to control the level of fat absorbed by the alphabites and to maintain their shape & texture\", \"Free From Gluten\", \"Suitable for Vegans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Chips, Potatoes & Rice','Potato Products','null','null','yes','null','null','null','null','1.6','null','null','null','null','null','null','null','Ocado','null');
