horoughly until piping hot throughout.\", \"Tastiest when oven baked straight from the freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Grill - From Frozen. High Grill 10 Mins\", \"Pre-heat the grill.\", \"Cook on medium to low level.\", \"Turn over frequently.\", \"Cook until crisp and golden.; Oven cook - From Frozen. 210\\u00b0C Fan 190\\u00b0C Gas Mark 7 12 Mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Turn over halfway through cooking.\", \"Cook until crisp and golden.\", \"Heat Sealed\", \"Film - Not Recyclable\", \"Full Product Name:\", \"Nuggets formed from chopped marinated chicken breast, coated in blended wholegrain breadcrumbs, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"4 Servings\", \"Additional Information:\", \"24** Chicken Nuggets\", \"**Average Nuggets per pack\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For a sustainable tomorrow\", \"Making a difference with responsibly sourced and prepared food every day\", \"birdseye.co.uk/our-sustainable-path\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Chicken Brea