ck, Black Pepper), Courgette (13%), Broccoli, Edamame Beans (\", \"Soya\", \"), Lentils (10%)\", \"Contains Milk, Contains Soya, May Contain Wheat\", \"May contain\", \"Wheat\", \"Suitable for Vegetarians\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/450/450845011_1_640x640.jpg?identifier=a3bdb86914ff7d47cd80ba1eaf1007ef','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Vegetarian','Ready Meals','null','null','yes','null','null','null','null','2.5','null','null','null','null','null','null','null','Ocado','null');
