, \"Delicious in 4 1/2 mins, 2 pyramids portions, No artificial colours, flavours or preservatives, Suitable for vegetarians\", \"United Kingdom\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Microwave - From Frozen. Microwave straight from the freezer.\", \"1. Open the outer bag. Remove the pyramid bag(s) and place with the Green Corner Upwards, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping and shake the bags halfway through cooking.\", \"Do not pierce the bag. Do not microwave the outer (printed) packaging.\", \"2. Full Power\", \"1 bag - 650W/B: 4 mins, 750W/D: 3 1/2 mins, 850W/E: 3 1/2 mins\", \"2 bags - 650W/B: 8 1/2 mins, 750W/D: 7 1/2 mins, 850W/E: 6 1/2 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, shake, then cut the bag open to serve.\", \"Be careful! The contents will be very hot. Stir Well.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to escape slowly during cooking.; Shallow Fry - From Frozen. Alternatively, Pan cook\", \"Low/Medium heat 6-8 mins\", \"Empty the contents of the bag into a pan.\", \"Add 1-2 tablespoons of water to prevent the rice from sticking to the pan.\", \"Heat gently with a lid on to retain moisture.\", \"Stir frequently until cooked, adding more water if required.\", \"Heat Sealed\", \"Bag - Plastic - Not Currently Recycled; Pouch - Plastic - Not Currently Recycled\", \"Full Product Name:\", \"Steamed Long Grain Yellow Rice with Peas, Carrot & Sweetcorn and Seasoning.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"2 Servings\", \"Origin:\", \"Made in the United Kingdom\", \"Birds Eye\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and 