frosting.\", \"Keep Frozen\", \"Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Microwave - From Frozen. To retain more vitamins, Microwave straight from the freezer.\", \"1. Open the outer bag. Remove the pyramid bag(s) and place with the green corner upwards, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping and shake the bags halfway through cooking.\", \"Do not pierce the bag. Do not microwave the outer (printed) packaging.\", \"2. Full Power.\", \"1 bag: 650W/B: 3 1/2 mins, 750W/D: 3 mins, 850W/E: 3 mins\", \"2 bags: 650W/B: 6 mins, 750W/D: 5 1/2 mins, 850W/E: 5 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, shake, then cut the bag open to serve. Be careful! The contents will be very hot. Stir Well.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to escape slowly during cooking.; Shallow Fry - From Frozen. Alternatively, Pan cook.\", \"Medium Heat: 6 mins.\", \"Empty the contents of the bag into a pan.\", \"Add 3-4 tablespoons of water to prevent the vegetables from sticking to the pan.\", \"Heat gently with a lid on to retain moisture.\", \"Stir occasionally until cooked, adding more water if required.\", \"Heat Sealed\", \"Full Product Name:\", \"Green beans, peas, broccoli and mange tout with garlic and herb butter.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"2 Servings\", \"Origin:\", \"Made in the United Kingdom\", \"Birds Eye\", \"Veg Fusions is an exciting fusion of fresh vegetables complemented with selected herbs & seasonings to give you a quick and delicious dish suitable for any meal.\", \"Our unique Pyramid Steamer gently steam-cooks the vegetables & seasonings allowing the flavours to gently infuse for a delicious fresh dish in minutes.\", \"Birds Eye\\u2122 Forever Food\", \"Working for a sustainable future\", \"At Birds Eye, we care about future generations as much as we do about you and your family today. That\'s why we work sustainably with our partners & suppliers to deliver you the freshest and most nutritious vegetables possible, today and in the future.\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and preparing your food, creating new products that contribute to a balanced diet, and helping everyone to reduce food waste. For more, visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Vegetables (94%) (Green Beans, Peas, Broccoli, Mange Tout), Butter (\", \"Milk\", \"), Chives, Rice Starch, Salt, Garlic Powder, Thyme, Black Pepper\", \"Suitable for Vegetarians\", \"Contains Milk\", \"Contains Lactose\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Mixed Packs','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
