\"Low / Medium heat 9-10 mins\", \"Empty the contents of the bag into a wok or non-stick pan [approx. 24cm diameter]. Add 2-3 tablespoons of water and heat on a high setting until the sauce starts to melt. Simmer gently on a low to medium heat, stirring regularly until the sauce has been absorbed and the prawns and chicken are cooked through.\", \"Not suitable for microwave cooking: Contains raw prawns.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.\", \"Unspecified Pack\", \"Film - Plastic - Not Currently Recycled\", \"Full Product Name:\", \"Cooked yellow rice, cooked chicken and king prawns with a rich tomato sauce.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Prawns are a shellfish and although great care has been taken to remove all of the shell, some may remain.\", \"Usage:\", \"1 Servings\", \"Origin:\", \"Made in Germany from imported king prawns and chicken\", \"Birds Eye\", \"Why not try our delicious Sun-Ripened Tomato & Basil Fish Chargrills\", \"You know that feeling - it\'s the middle of the week, you get home and you\'ve got the same old meals in the kitchen. But we believe that your mid-week deserves more!\", \"That\'s why we created Birds Eye Inspirations; a collection of mouth-watering dishes made with only the freshest, finest ingredients.\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Cooked Rice (45%) (Water, Rice, Salt, Turmeric), Peas, Red Pepper, Cooked Marinated Chicken (10%) (Chicken Breast, Water, Sunflower Oil, Dextrose, Rice Flour, Salt), Onion, King Prawns (\", \"Crustaceans\", \") (9%), Palm Fat, Water, Vegetable Stock (Dextrose, Salt, Potato Starch, Carrot, Onion, Leek, Shallots, Tomato, Paprika), Coconut Oil, Sunflower Oil, Tomato Powder, Chicken Powder, Paprika, Salt, Palm Kernel Oil, Garlic Powder, Onion Powder, Oregano, Chilli, Saffron\", \"Contains Crustaceans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Ready Meals & Party Food','Mexican & Mediterranean','Mediterranean','null','yes','null','null','null','null','2.2','null','null','null','null','null','null','null','Ocado','null');
