and golden.; Oven cook - From Frozen. Tastiest when Oven Baked Straight from the Freezer.\", \"230\\u00b0C, Fan 210\\u00b0C, Gas Mark 8 12-15 mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the top part of the oven.\", \"Turn over halfway through cooking.\", \"Cook until crisp and golden.\", \"Box\", \"Carton - Recyclable\", \"Full Product Name:\", \"Alaska pollock fillet Fish Fingers, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"2 Servings\", \"Additional Information:\", \"MSC - Certified Sustainable Seafood MSC\\u2122, MSC-C-50470, Choose the Blue Fish, Thank you for choosing fish that has met the MSC\'s global standard for sustainability. Together we can help protect fish stocks for the future. Find out more at www.msc.org\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Follow the fish and visit www.birdseye.co.uk to find out where this fish comes from and how we fish sustainably.\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Alaska Pollock (\", \"Fish\", \") (58%), Breadcrumb Coating*, Rapeseed Oil, *Breadcrumb Coating (\", \"Wheat\", \"Flour, Water, Potato Starch, Salt, Paprika,\", \"Fish\", \"Oil, Yeast, Turmeric)\", \"Contains Wheat\", \"Contains