en\", \"Cooking Instructions - General. Your gluten free southern fried chicken contains raw meat, please ensure that it is cooked thoroughly until piping hot throughout.\", \"Tastiest when oven baked straight from the freezer.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Grill - From Frozen. Medium Grill 20 Mins\", \"Pre-heat the grill.\", \"Turn over occasionally.\", \"Cook until crisp.; Oven cook - From Frozen. 200\\u00b0C, Fan 180\\u00b0C, Gas Mark 6 25 Mins\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Cook until crisp.\", \"Box\", \"Carton - Recyclable\", \"Full Product Name:\", \"Grills formed from marinated chunks of chicken breast, coated in gluten free breadcrumbs blended with spices, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"2 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For a Sustainable Tomorrow\", \"Making a difference with responsibly sourced and prepared food every day\", \"Birdseye.co.uk/our-sustainable-path\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline Information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Chicken Breast (53%), Water, Rapeseed Oil, Breadcrumbs (Rice Flour, Gram Flour, Cornflour, Salt, Dextrose), Cornflour, Flour (Maize, Rice), Rice Semolina, Spices, Salt, Yeast Extract, Potato Starch, Maltodextrin, Garlic Powder, Onion Powder, Natural Flavourings, Raising Agents (Diphosphates, Sodium Carbonates), Sage, Garlic Extract, Onion Oil, Spice Extracts\", \"May Contain Eggs, Free From Gluten\", \"May also contain\", \"Egg\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/425/425936011_1_640x640.jpg?identifier=558823e12f3aa1a0658d401833289eaa','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Meat & Poultry','Breaded Chicken, Nuggets & Kievs','Breasts & Steaks','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
