 mins, 4 individual steamers, No artificial colours, flavours or preservatives, Suitable for vegans\", \"United Kingdom\", \"Keep Frozen\", \"Microwave - From Frozen. To retain more vitamins, microwave straight from the freezer.\", \"1. Open the outer bag. Remove the steam bag(s) and place with the printed side up, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping.\", \"Do not pierce the bag. Do not microwave the outer (printed) packaging.\", \"2. Microwave on Full Power for:\", \"700W: 1 bag 2 1/2 mins, 2 bags 4 1/2 mins\", \"800W: 1 bag 2 1/2 mins, 2 bags 4 1/2 mins\", \"900W: 1 bag 2 mins, 2 bags 4 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, drain and serve. Tear the bag open along the dotted line.\", \"Be careful! The contents will very hot.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to escape slowly during cooking and a slight whistling sound may be heard.\", \"Please ensure food is cooked until piping hot\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.\", \"Unspecified Pack\", \"Film - Plastic - Not Currently Recycled; Pouch - Plastic - Not Currently Recycled\", \"Full Product Name:\", \"Carrots, Broccoli Florets and Sweetcorn.\", \"Storage:\", \"Store in a freezer -18\\u00baC or cooler\", \"Usage:\", \"4 Servings\", \"Birds Eye\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and preparing your food, creating new products that contribute to a balanced diet, and helping everyone to reduce food waste.\", \"Enjoy Steamfresh Family Favourite Mix as part of a varied and balanced diet and healthy lifestyle.\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Care information...\", \"Call us free on 0800 33 22 7