ve you perfect results every time.\", \"Our Aromatic Indian Rice is a delicious mix of healthy ingredients, ready to steam in 4 minutes!*\", \"#Protein contributes to the maintenance of muscle mass.\", \"*Stand for 1 minute.\", \"One Birds Eye Aromatic Indian Steambag provides one of your recommended 5 daily portions of fruit and vegetables.\", \"1 of 5 a day, 2 bags, No artificial colours, flavours or preservatives, Vegan\", \"United Kingdom\", \"Keep Frozen\", \"Are you looking for some inspiration?\", \"Serve our Aromatic Indian Rice with hot and spicy chicken grills, sliced cucumber and a yoghurt dip!\", \"Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Microwave - From Frozen. Microwave straight from the freezer.\", \"1. Open the outer bag. Remove the pyramid bag(s) and place with the green corner upwards, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping and shake the bags halfway through cooking.\", \"Do not pierce the bag. Do not microwave the outer (printed) packaging.\", \"2. Full Power.\", \"1 bag - 700W: 4 mins, 800W: 4 mins, 900W: 3 mins\", \"2 bags - 700W: 8 mins, 800W: 8 mins, 900W: 6 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, shake, then cut the bag open to serve.\", \"Be careful! The contents will be very hot. Stir well.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to escape slowly during cooking.; Shallow Fry - From Frozen. Alternatively, Pan cook.\", \"Medium heat 6-8 mins\", \"Empty the contents of the bag into a pan.\", \"Add 2-3 tablespoons of water to prevent the rice from sticking to the pan.\", \"Heat gently with a lid on to retain moisture.\", \"Stir frequently until cooked, adding more water if required.\", \"Pack\", \"Full Product Name:\", \"White, Red and Black Rice, Spinach, Cauliflower and Lentils with an Indian Style Seasoning.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"2 Servings\", \"Origin:\", \"Made in the United Kingdom\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Aromatic Indian Rice as part of a varied and balanced diet and healthy lifestyle.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon-Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Mixed Rice (Long Grain White, Red, Black) (48%), Spinach (18%), Cauliflower (16%), White Onions, Lentils (4%), Sunflower Oil, Coriander, Vegetable Stock, Cumin, Turmeric, Garam Masala, Salt, Cayenne Pepper\", \"May Contain Mustard, May Contain Soya, May Contain Wheat\", \"May also contain\", \"Wheat\", \",\", \"Mustard\", \"and\", \"Soya\", \"Suitable for Vegans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Chips, Potatoes & Rice','Rice','null','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
