o artificial colours, flavours or preservatives\", \"Keep Frozen\", \"Looking for inspiration?\", \"Try adding our Very Fine Green Beans to saut\\u00e9ed diced charlotte potatoes and bacon for a tasty side. Or next time you make a Thai Green curry, add in a handful of green beans for a little crunch and a burst of natural goodness. Simply stir in and continue to cook until tender and piping hot throughout.\", \"Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze once defrosted.; Hob - From Frozen. Tastiest when boiled straight from the freezer.\", \"Place in a pan and add sufficient boiling water to cover.\", \"Bring back to the boil.\", \"Cover and simmer for 2 1/2 minutes.\", \"Drain and serve.\", \"Season to taste.; Microwave - From Frozen. Alternatively, microwave.\", \"For 160g (2 servings).\", \"Place in a microwavable bowl.\", \"Add 15ml (1tbsp) of water and cover.\", \"Microwave on Full Power for:\", \"700W 4 mins, 800W 31/2 mins, 900W 3 1/2mins\", \"Drain and serve.\", \"Season to taste.\", \"Pack\", \"Packing - Recycle with carrier bags at larger stores - Not at Kerbside\", \"Full Product Name:\", \"Very Fine Green Beans.\", \"Storage:\", \"Store in a freezer at -18\\u00baC or cooler\", \"See back of pack for best before end date\", \"Usage:\", \"9 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Very Fine Green Beans as part of a varied and balanced diet and healthy lifestyle\", \"For more visit birds.eye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Peas & Broad Beans','Green Beans','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
