l - From Frozen. High grill, 8 - 12 mins\", \"Pre-heat the grill.\", \"Turn over halfway through cooking.\", \"Cook until crisp and golden yellow.\", \"Do not overcook. Follow recommended cooking times.; Oven cook - From Frozen. Tastiest when oven baked straight from the freezer.\", \"220\\u00b0C, Fan 200\\u00b0C, Gas Mark 7, 15 mins.\", \"Pre-heat the oven.\", \"Place on a baking tray in the middle of the oven.\", \"Turn over halfway through cooking.\", \"Cook until crisp and golden yellow.\", \"Do not overcook. Follow recommended cooking times.\", \"If preparing smaller quantities, reduce the cooking time.\", \"Our real potatoes vary throughout the year, so the time taken to become crisp and golden yellow may also vary.\", \"Pack\", \"Carton - Recyclable\", \"Full Product Name:\", \"Waffles made with freshly mashed potatoes, prefried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Usage:\", \"18 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Potato (87%), Rapeseed Oil, Potato Granules, Potato Starch, Salt, Stabiliser (E464)#, White Pepper, # E464 is derived from a natural plant material. We use it to control the level of fat absorbed by the waffles and to maintain their shape & texture\", \"Free From Gluten\", \"Suitable for Vegans\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','n