shness.\", \"All this love and attention goes into our Petits Pois - picked when they are young and juicy to give you a burst of sweetness every time\", \"Our Petits Pois are a source of vitamin C and a rich source of protein in which makes them great for your immune system* and for your muscles**\", \"*Vitamin C contributes to the normal function of the immune system\", \"**Protein contributes to the maintenance of muscle mass\", \"A burst of sweetness, Source of vitamin C, With love, 1 of 5 a day servings, No artificial colours, flavours or preservatives\", \"UK\", \"Keep Frozen\", \"Add Petits Pois to Watercress and Mozzarella for a fresh and tasty salad.\", \"Boil - From Frozen. Place in a pan and add sufficient boiling water to cover.\", \"Bring back to the boil.\", \"Cover and simmer for 2 minutes.\", \"Drain and serve. Season to taste.; Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Microwave - From Frozen. To retain more vitamins, microwave straight from the freezer.\", \"For 160g (2 servings).\", \"Place the petits pois in a microwavable bowl.\", \"Add 15ml (1tbsp) of water and cover.\", \"Microwave on Full Power for:\", \"700W 3 1/2 mins, 800W 3 mins, 900W 2 1/2 mins\", \"Drain and serve.\", \"Season to taste.\", \"Re-Closable Packaging\", \"Packing - Not Recyclable\", \"Full Product Name:\", \"Petits Pois\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"See back of pack for best before end date\", \"Usage:\", \"13 Servings\", \"Birds Eye\", \"Try our Birds Eye Pulses Range!\", \"All our tasty mixes are rich in protein, cook in minutes from frozen and are perfect for your favourite recipes!\", \"Chickpea and Spinach Mix... perfect for curries\", \"Mexican Bean Mix... perfect for chilli con carne\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Petits Pois as part of a varied and balanced diet and healthy lifestyle\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"UK\", \"Careline information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Peas.\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/373/37324011_1_640x640.jpg?identifier=931bdc73e03753f408e06aeace5b1a61','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Peas & Broad Beans','Green Peas','yes','null','null','null','null','3.29','null','null','null','null','null','null','null','Ocado','null');
