save 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Mixed Beans (67%) (Red Kidney Beans, Black Beans), Chickpeas\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/397/397504011_1_640x640.jpg?identifier=5714d2463d2c967870d3c0c5099a34a0','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Mixed Packs','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
