re,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Wild Pink Salmon (\", \"Fish\", \") (83%), Water, Palm Kernel Oil, Rapeseed Oil, Butter (\", \"Milk\", \"), Dill, Salt, Rice Starch, Natural Emulsifier (Sunflower Lecithin)#, Extra Virgin Olive Oil, Spices,\", \"Fish\", \"Gelatine, Lemon Extract, #Lecithin is used to help the Sauce Blend with the Fish Juices on cooking, it is a natural material found in many traditional food ingredients\", \"Contains Fish, Contains Milk, May Contain Mustard, May Contain Wheat\", \"Contains Fish\", \"Contains Milk\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/460/46009011_1_640x640.jpg?identifier=1cdeb5864275f39ef1dc742c8ce1223e','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fish','Fish Pies & Meals','Fish Dishes','null','yes','null','null','null','null','4.5','null','null','null','null','null','null','null','Ocado','null');
