amin A and Vitamin C contribute to the normal function of the immune system. Protein contributes to a growth in and the maintenance of muscle mass\", \"Delicious in 3 1/2 mins, Rich source of protein, 1 of 5 a-day, No artificial colours, flavours or preservatives, Suitable for vegetarians\", \"United Kingdom\", \"Keep Frozen\", \"With lemon zest and cracked black pepper\", \"Are you looking for some inspiration?\", \"Stir through some lemon zest and ground cumin for a warming flavour or lemon and cracked black pepper for a refreshing and lively dish. Serve with poached or grilled fish and new potatoes.\", \"Microwave - From Frozen. To retain more vitamins, microwave straight from the freezer.\", \"1. Open outer bag. Remove pyramid bag(s) and place with the green corner upwards, unopened, into the microwave. If cooking more than one bag make sure that they are not overlapping and shake the bags halfway through cooking.\", \"Do not pierce the bag. Do not microwave outer (printed) packaging.\", \"2. Full power\", \"1 bag -700W: 3 mins, 800W: 3 mins, 900W: 2 1/2 mins\", \"2 bags - 700W: 5 mins, 800W: 5 mins, 900W: 4 1/2 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, shake then cut the bag open to serve.\", \"Be careful! The contents will be very hot. Stir well.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.\", \"Pack\", \"Film - Not Recyclable; Pouch - Not Recyclable\", \"Full Product Name:\", \"Garden Peas, Leaf Spinach and Romanesco Broccoli Florets\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"2 Servings\", \"Origin:\", \"Made in the United Kingdom\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Enjoy Steamfresh as part of a varied and balanced diet and healthy lifestyle\",