ct taste you won\'t find anywhere else?\", \"Boil - From Frozen. Place in a pan and add sufficient boiling water to cover.\", \"Bring back to the boil.\", \"Cover and simmer for 3 minutes.\", \"Drain and serve. Season to taste.; Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Microwave - From Frozen. To retain more vitamins, Microwave Straight from the Freezer.\", \"For 160g (2 servings)\", \"Place the Garden Peas in a microwavable bowl.\", \"Add 15ml (1tbsp) of water and cover.\", \"Microwave on full power for:\", \"700W: 3 1/2 mins, 800W: 3 mins, 900W: 2 1/2 mins\", \"Drain and serve. Season to taste.\", \"Pack\", \"Packing - Recycle with carrier bags at larger stores - Not at Kerbside\", \"Full Product Name:\", \"Garden Peas\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"See back of pack for best before end date\", \"Usage:\", \"4 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"From seed to plate, peas grown with love only from Birds Eye\", \"For over 70 years we have been dedicated to growing the tastiest peas. We\'ve worked with three generations of farmers to build up the knowledge, passion and care needed to create the perfect pea.\", \"Our fieldsmen have helped nurture 8 unique varieties that are harvested on the day when they\'re at their very best.\", \"We then ensure all our peas are frozen within 2 1/2 hours to capture their freshness. All this love and attention goes into our deliciously tender Garden Peas.\", \"Enjoy Garden Peas as part of a varied and balanced diet and healthy lifestyle\", \"For more, visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/549/54909011_1_640x640.jpg?identifier=228aa4cb928fa0021c543b2d34b71c4b','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Peas & Broad Beans','Green Peas','yes','null','null','null','null','1.3','null','null','null','null','null','null','null','Ocado','null');
