rowave, shake gently.\", \"Tear or cut the end of the bag with scissors.\", \"Be careful! The bag and contents will be very hot.\", \"Fish comes in all sorts of shapes and sizes, and so do ovens and microwaves, so while you\'ll always get a tasty fish dish the shape of fillet and sauce quantity may also vary.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.; Microwave - From Frozen. Alternatively, microwave.\", \"1 bag\", \"Full power for: 700W 5 mins\", \"Full power for: 800W 4 1/2 mins\", \"Full power for: 900W 4 1/2 mins\", \"2 bags\", \"Full power for: 700W 9 mins\", \"Full power for: 800W 8 mins\", \"Full power for: 900W 8 mins\", \"Let stand for 1 minute.; Oven cook - From Frozen. Pre-heat the oven 190\\u00b0C Fan 170\\u00b0C Gas Mark 5 30 mins\", \"Place the bag containing the fish on a baking tray in the middle of the oven.\", \"Do not pierce the bag.\", \"Cook for the required time.\", \"Two or more portions may require longer time.\", \"Box\", \"Carton - Recyclable; Film - Not Recyclable\", \"Full Product Name:\", \"Cod fillets with a tomato and rosemary sauce.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"2 Servings\", \"Additional Information:\", \"MSC - Certified Sustainable Seafood, MSC\\u2122, MSC-C-50470, Thank you for choosing fish that has met the MSC\'s global standard for sustainability. Together we can help protect fish stocks for the future. Find out more at www.msc.org\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"If writing, please enclose the Best Before End panel.\", \"Cod (\", \"Fish\", \") (83%), Water, Palm Kernel Oil, Extra Virgin Olive Oil, Tomato Flakes, Sage, Salt, Rice Starch, Rosemary, Natural Emulsifier (Sunflower Lecithin)#, Cornflour, Onion Powder, Black Pepper,\", \"Fish\", \"Gelatine, #Lecithin is used to help the Sauce Blend with the Fish Juices on cooking, it is a natural material found in many traditional food ingredients\", \"Contains Fish, May Contain Milk, May Contain Mustard, May Contain Wheat\", \"May also contain\", \"Wheat, Milk\", \"and\", \"Mustard\", \"Free From Artificial Colours\", \"Free From Artificial Flavours\", \"Free From Artificial Preservatives\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/561/56163011_1_640x640.jpg?identifier=51455848db99a491587b6ef70c3ef55f','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fish','Fish Pies & Meals','Fish Dishes','null','yes','null','null','null','null','4.5','null','null','null','null','null','null','null','Ocado','null');
