ns, No artificial colours or flavours\", \"United Kingdom\", \"Microwave - From Frozen. Tastiest when microwaved straight from the freezer.\", \"1. Place the bag with the vent side up, onto the turntable.\", \"2. Microwave on Full Power for:\", \"650W/B: 3 mins, 750W/D: 3 mins, 850W/E: 3 mins\", \"3. Shake the bag gently.\", \"4. Microwave on Full Power.\", \"650W/B: 3 1/2 mins, 750W/D: 3 mins, 850W/E: 3 mins\", \"5. Stand for 1 minute. Remove the bag from the microwave, shake gently, then cut the bag open to serve. Be Careful! The Contents will be very Hot. Stir well.\", \"During cooking the bag will slowly inflate as the steam builds up.\", \"A special vent in the bag will allow the steam to escape slowly during cooking.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.\", \"Pack\", \"Film - Plastic - Not Currently Recycled\", \"Full Product Name:\", \"Cooked Penne Pasta with Peas and Broccoli in a Creamy Cheese Sauce.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"1 Servings\", \"Origin:\", \"Made in the United Kingdom\", \"Birds Eye\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and preparing your food, creating new products that contribute to a balanced diet, and helping everyone to reduce food waste.\", \"For more, visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Cooked Pasta (40%) (Water, Durum\", \"Wheat\", \"Semolina), Peas (21%), Broccoli (18%), Semi Skimmed\", \"Milk\", \", Water, Cheese (4%) (Processed Gorgonzola (\", \"Milk\", \") (Water, Gorgonzola Cheese (\", \"Milk\", \"), Blue Cheese (\", \"Milk\", \"), Curd (\", \"Milk\", \"), Butter (\", \"Milk\", \"), Starch (Potato and Rice), Salt, Whey Powder (\", \"Milk\", \"),\", \"Milk\", \"Protein), Vegetarian Gouda (\", \"Milk\", \") (contains Natural Colour: Beta-Carotene), Parmesan Cheese (contains\", \"Milk\", \")), Sunflower Oil, Onion, Rice Starch, White Wine,\", \"Wheat\", \"Flour, Salt, Vegetable Stock (Dextrose, Salt, Carrot, Onion, Leeks, Shallots, Tomato, Paprika), Spices\", \"Contains Milk, May Contain Soya, Contains Wheat\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Ready Meals & Party Food','Lasagne, Pasta & Rice','Pasta','null','yes','null','null','null','null','2','null','null','null','null','null','null','null','Ocado','null');
