 \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Prefried Chips (52%) (Potato, Sunflower Oil, Dextrose), Peas (19%), Cod (\", \"Fish\", \") (13%), Water, Fortified\", \"Wheat\", \"Flour (\", \"Wheat\", \"Flour, Calcium Carbonate, Iron, Niacin, Thiamin), Rapeseed Oil, Breadcrumbs (Fortified\", \"Wheat\", \"Flour (\", \"Wheat\", \"Flour, Calcium Carbonate, Iron, Niacin, Thiamin), Dextrose, Salt), Starch (Potato,\", \"Wheat\", \"), Flour (Rice, Maize), Salt, Raising Agents (E450, E500)#, Palm Fat, Dextrose, Skimmed\", \"Milk\", \"Powder,\", \"Mustard\", \", Natural Flavourings, Spice Extract, # E450 and E500 are the basic ingredients of Baking Powder, which is used to make the Batter light and crispy\", \"Contains Fish, Contains Milk, Contains Mustard, Contains Wheat\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Ready Meals & Party Food','Fish Pies & Meals','Fish Dishes','null','yes','null','null','null','null','2.5','null','null','null','null','null','null','null','Ocado','null');
