vegetarians\", \"United Kingdom\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Do not refreeze once defrosted.\", \"\", \"Keep Frozen\", \"Microwave - From Frozen. To retain more vitamins, Microwave Straight from the freezer.\", \"1. Open outer bag. Remove steam bag(s) and place printed side up, unopened on a microwavable plate. Place in the microwave. If cooking more than one bag make sure that they are not overlapping.\", \"Do not pierce the bag. Do not microwave outer (printed) packaging.\", \"2. Full Power.\", \"1 bag; 650W/B 3 1/2 mins, 750W/D 3 mins, 850W/E 2 1/2 mins\", \"2 bags; 650W/B 6 mins, 750W/D 5 1/2 mins, 850W/E 5 mins\", \"3. Stand for 1 minute. Remove the bag from the microwave, drain and serve.\", \"During cooking the bag will slowly inflate as the steam builds up. A special vent in the bag will allow the steam to slowly escape during cooking and a slight whistling sound may be heard.\", \"Tear bag open along dotted line and serve.\", \"Be careful! The contents will be very hot.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do Not refreeze after defrosting.\", \"Heat Sealed\", \"Full Product Name:\", \"Carrots, Peas and Sweetcorn\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"Usage:\", \"4 Servings\", \"Origin:\", \"Made in United Kingdom\", \"Birds Eye\", \"Forever Food Together\", \"Our commitment to a sustainable future means responsibly sourcing and preparing your food, creating new products that contribute to a balanced diet, and helping everyone to reduce food waste.\", \"For more, Visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Car