ady to cook, so you can free yourself from soaking dry pulses overnight or draining tins!\", \"Enjoy Chickpea and Spinach Mix as part of a varied and balanced diet and healthy lifestyle.\", \"One portion of Birds Eye Chickpea & Spinach Mix provides one of your recommended 5 daily portions of fruit and vegetables.\", \"With lentils & cauliflower, Perfect for curries, Rich in protein, With love, 1 of your 5 a day, No artificial colours, flavours or preservatives\", \"Keep Frozen\", \"Are you looking for some inspiration?\", \"Delicious Veggie Curry\", \"In a deep pan, fry chopped onions, ginger and garlic. Then add your favourite curry sauce and our Chickpea & Spinach Mix straight from the bag.\", \"Cook gently for 15 minutes.\", \"Finish with chopped coriander.\", \"Boil - From Frozen. Tastiest when boiled straight from the freezer\", \"For 200g (approximately 2 servings)\", \"1. Place 200g in a pan and add sufficient boiling water to cover.\", \"2. Cover and bring back to the boil.\", \"3. Once boiling, simmer for 3 minutes.\", \"4. Drain and serve.\", \"Season to taste.; Cooking Instructions - General. Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.; Microwave - From Frozen. For 200g (approximately 2 servings)\", \"1. Place 200g in a microwavable bowl, add 1 tbsp (15ml) water and cover.\", \"Place in the microwave.\", \"2. Microwave on Full Power for:\", \"700W 5 mins, 800W 4 1/2 mins, 900W 4 mins\", \"3. Stand for 1 minute. Drain and serve.\", \"Season to taste.\", \"Pack\", \"Packing - Not Recyclable\", \"Full Product Name:\", \"A mix of spinach, chickpeas, cauliflower and lentils.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler\", \"See back of pack for best before and date\", \"Usage:\", \"4 Servings\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Spinach (29%), Chickpeas (25%), Cauliflower, Lentils\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Mixed Packs','null','yes','null','null','null','null','1.6','null','null','null','null','null','null','null','Ocado','null');
