et and healthy lifestyle\", \"For more visit birdseye.co.uk\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Careline information...\", \"Call us free on 0800 33 22 77 Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.uk\", \"If writing, please enclose the Best Before End panel.\", \"Garden Peas\", \"Suitable for Vegetarians\"]','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://www.ocado.com/productImages/200/200045011_1_640x640.jpg?identifier=5a3b91cc36f6b3cc113e6ade29ad2329','null','null','null','null','null','null','null','null','null','null','null','null','null','Frozen','Fruit, Vegetables & Herbs','Vegetables','Peas & Broad Beans','Green Peas','yes','null','null','null','null','2.15','null','null','null','null','null','null','null','Ocado','null');
