oesn\'t get any better than that. So when you want to re-live those happy memories, reach for delicious large Cod fillets coated in Harry Ramsden\'s world famous secret recipe batter. Tasty on a Friday, served with chips and your favourite sauce!\", \"Oven cook - From Frozen. Tastiest when oven baked straight from the freezer.\", \"Pre-heat the oven 220\\u00b0C, Fan 200\\u00b0C, Gas Mark 7\", \"Place on a baking tray in the middle of the oven.\", \"20 minutes\", \"Crispy and golden.\", \"Serve with your favourite sides.\", \"Please ensure food is cooked until piping hot.\", \"These instructions are guidelines only.\", \"Do not refreeze after defrosting.\", \"Box\", \"Carton - Recyclable\", \"Full Product Name:\", \"Portions formed from pieces of cod fillet, coated in a crispy batter, lightly fried.\", \"Storage:\", \"Store in a freezer at -18\\u00b0C or cooler.\", \"Safety Warning:\", \"Although great care has been taken to remove all bones, some may remain.\", \"Usage:\", \"4 Servings\", \"Additional Information:\", \"MSC - Certified Sustainable Seafood MSC\\u2122, MSC-C-50470, Choose the Blue Fish, Thank you for choosing fish that has met the MSC\'s global standard for sustainability. Together we can help protect fish stocks for the future, Find out more at www.msc.org\", \"Birds Eye\", \"Forever Food Together\", \"We are passionate about our sustainability programme to provide you with tasty and nutritious food that is responsibly sourced and prepared - forever.\", \"Follow the fish and visit www.birdseye.co.uk to find out where this fish comes from and how we fish sustainably.\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"Birds Eye Ireland,\", \"Monread Rd,\", \"Naas,\", \"Co. Kildare,\", \"W91 HE67,\", \"Ireland.\", \"Careline information...\", \"Call us free on 0800 33 22 77\", \"Mon - Fri 8am to 6pm\", \"ROI: Callsave 1850 298 398\", \"Birds Eye Limited,\", \"Freepost ADM3939,\", \"London,\", \"SW1A 1YS.\", \"www.birdseye.co.